import React from 'react';
import './Header.css';
import carecloud from '../images/Carecloud.png';
import Iconimge from '../images/Carecloud.png';


const Header = () => {
  return (
    <div className="header-container">
        <div className="logo img">
         <img src = {carecloud} alt = "camoany logo"></img>
        </div>
      {/* Left side - Hamburger menu */}
      <div className="menu-icon">
        <span className="menu-bars">&#9776;</span>
      </div>

      {/* Right side - User profile */}
      <div className="user-profile">
        <div className="user-info">
            <div className="logo">
            <img src={Iconimge}alt="Profile" className="profile-pic" />
            </div>
          
          <div>
            <p >Thanuka Manuranga</p>
            <p>System Developer</p>
          </div>
        </div>
        <div className="status">
          <span className="status-indicator"></span>
          <span className="dropdown-icon">&#x25BC;</span>
        </div>
      </div>
    </div>
  );
};

export default Header;
